css:
atom-workspace.paner-maximize .tab-bar {
  display: none;
}
atom-workspace.paner-maximize atom-pane-container {
  position: relative;
}
atom-workspace.paner-maximize atom-pane-container atom-pane {
  display: none;
}
atom-workspace.paner-maximize atom-pane-container atom-pane.active {
  display: flex;
  position: absolute;
  top: 0;
  right: 0;
  left: 0;
  bottom: 0;
  z-index: 100;
}
